    def findPoisonedDuration(self, timeSeries, duration):
        if timeSeries is None or 0 == len(timeSeries):
            return 0
        sumDuration = 0
        for i, t in enumerate(timeSeries):
            if 0 == i or duration < t - timeSeries[i - 1]:
                sumDuration += duration
            else:
                sumDuration += t - timeSeries[i - 1]
        return sumDuration


